import React,{useState} from 'react'
import Data from './Data';

const App = () => {
    const [data,setData] = useState(Data);
    return (
        <>
            <div className="container">
                    <h1 className="text-center text-capitalize mt-3">Order Your Item form the below list</h1>
                    <div className="row">
                        
                            {data.map((element,index)=>{
                                return(
                                    <div className="col-lg-4 col-xm-12 col-md-6 my-1">
                                    <div className="card">
                                        <img src="../images/poha.jpg" alt="poha pic" className="card-img" width="200" height="200"/>
                                        <div className="card-body">
                                            <h2 className="card-title text-capitalize text-center">poha</h2>
                                            <p className="card-text text-capitalize text-center">Lorem, ipsum.</p>
                                            <button className="btn btn-outline-warning ">Order</button>
                                        </div>
                                    </div>
                                    </div>
                                )
                            })
                           }
                     
                    </div>
            </div>
        </>
    )
}

export default App;
